syntax = "proto3";
package com.snapchat.proto;
option optimize_for = CODE_SIZE;
option objc_class_prefix = "SCPB";
option csharp_namespace = "SnapProto.Com.Snapchat.Proto";

message SCPBUnlockablesScheduleInterval {
    string startDateTime = 1;
    string endDateTime = 2;
    int64 startMillisSinceEpoch = 3;
    int64 endMillisSinceEpoch = 4;
}